  String result = "";
  int strLen = strlen(hexStr);

  // HexadecimÃ¡lis sztring hossza mindig pÃ¡ros szÃ¡m kell legyen
  if (strLen % 2 != 0) {
    return result;
  }

  for (int i = 0; i < strLen; i += 2) {
