class RandomizedSet {

    unordered_set<int> values;

public:
    
    bool insert(int val) {
        if (values.find(val) != values.end()) { return false; }
        values.insert(val);
        return true;
    }

    bool remove(int val) {
        if (values.find(val) == values.end()) { return false; }
        values.erase(val);
        return true;
    }

    int getRandom() {
        auto it = values.begin();
        advance(it, rand() % values.size());
        return (*it);
    }
};

